import "./App.css";
import { useState } from "react";
import Axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  // Datos Personales
  const [nombre, setNombre] = useState("");
  const [apellidoPaterno, setApellidoPaterno] = useState("");
  const [apellidoMaterno, setApellidoMaterno] = useState("");
  const [edad, setEdad] = useState(0);
  const [lugarNacimiento, setLugarNacimiento] = useState("");
  //DirecciÃ³n
  const [calle, setCalle] = useState("");
  const [colonia, setColonia] = useState("");
  const [codigoPostal, setCodigoPostal] = useState(0);
  const [municipio, setMunicipio] = useState("");
  const [estado, setEstado] = useState("");
  const [numeroExterior, setNumeroExterior] = useState(0);
  const [pais, setPais] = useState("");

  const [empleadosList, setEmpleados] = useState([]);

  const add = () => {
    Axios.post("http://localhost:3001/create", {
      nombre: nombre,
      apellidoPaterno: apellidoPaterno,
      apellidoMaterno: apellidoMaterno,
      edad: edad,
      lugarNacimiento: lugarNacimiento,
      calle: calle,
      colonia: colonia,
      codigoPostal: codigoPostal,
      municipio: municipio,
      estado: estado,
      numeroExterior: numeroExterior,
      pais: pais,
    }).then(() => {
      getEmpleados();
      alert("Empleado Registrado");
    });
  };

  const getEmpleados = () => {
    Axios.get("http://localhost:3001/empleados").then((response) => {
      setEmpleados(response.data);
    });
  };

  return (
    <div class="container">
      <div className="App">
        <div className="lista">
          {empleadosList.map((val, key) => {
            return <div className="">{val.nombre}</div>;
          })}
        </div>
      </div>
      <div className="card text-center">
        <div className="card-header">GestiÃ³n de empleados</div>
        <div className="card-body">
          <h2>Datos Personales</h2>
          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Nombre(s):{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setNombre(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa tu(s) nombre(s)"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>

          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Apellido Paterno:{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setApellidoPaterno(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa tu apellido paterno"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>

          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Apellido Materno:{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setApellidoMaterno(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa tu apellido materno"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>

          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Edad:{" "}
            </span>
            <input
              type="number"
              onChange={(event) => {
                setEdad(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa tu edad"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>

          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Lugar de Nacimiento:{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setLugarNacimiento(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa tu lugar de nacimiento (Municipio-DelegaciÃ³n, Estado)"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>

          {/* DirecciÃ³n */}
          <h2>DirecciÃ³n</h2>

          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Calle:{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setCalle(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa el nombre de la calle de tu domicilio"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>

          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Colonia:{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setColonia(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa la colonia de tu domicilio"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>
          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              CÃ³digo Postal:{" "}
            </span>
            <input
              type="number"
              onChange={(event) => {
                setCodigoPostal(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa el cÃ³digo postal de tu domicilio"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>
          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Municipio:{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setMunicipio(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa el municipio donde resides."
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>
          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Estado:{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setEstado(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa el estado en el que resides"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>
          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              NÃºmero Exterior:{" "}
            </span>
            <input
              type="number"
              onChange={(event) => {
                setNumeroExterior(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa el nÃºmero exterior de tu domicilio"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>
          <div className="input-group mb-3">
            <span className="input-group-text" id="basic-addon1">
              Pais:{" "}
            </span>
            <input
              type="text"
              onChange={(event) => {
                setPais(event.target.value);
              }}
              className="form-control"
              placeholder="Ingresa el pais en el que resides"
              aria-label="Username"
              aria-describedby="basic-addon1"
            />
          </div>
        </div>
        <div class="card-footer text-body-secondary">
          <button className="btn btn-success" onClick={add}>
            Registrar
          </button>
          <button className="btn btn-success" onClick={getEmpleados}>
            Listar
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
